/*Table structure for table `t_active` */

DROP TABLE IF EXISTS `t_active`;

CREATE TABLE `t_active` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `activetype` int(11) NOT NULL DEFAULT '0' COMMENT '活动类型枚举:0物品打折，1指定价格，2充值，3团购',
  `starttime` timestamp NULL DEFAULT NULL COMMENT '开始时间',
  `endtime` timestamp NULL DEFAULT NULL COMMENT '结束时间',
  `alllimitcnt` int(11) DEFAULT '0' COMMENT '总共可参与数量',
  `onelimitcnt` int(11) DEFAULT '0' COMMENT '每人每天可参与数量',
  `allsaledcnt` int(11) DEFAULT '0' COMMENT '总共已参与数量',
  `scalevalue` int(11) DEFAULT '100' COMMENT '折扣比例,如95,就是95折,不能设置为0,或者指定价格',
  `desc` varchar(512) NOT NULL COMMENT '描述',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

