/*Table structure for table `t_item` */

DROP TABLE IF EXISTS `t_item`;

CREATE TABLE `t_item` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '物品ID',
  `item_category_id` int(11) NOT NULL COMMENT '所属分类',
  `price` int(11) NOT NULL DEFAULT '1000' COMMENT '价格,单位分',
  `marketprice` int(11) NOT NULL DEFAULT '0' COMMENT '菜市场价格,单位分',
  `costprice` int(11) NOT NULL DEFAULT '0' COMMENT '成本价,单位分',
  `saleprice` int(11) NOT NULL DEFAULT '0' COMMENT '折后价,单位分',
  `leftcnt` int(11) NOT NULL DEFAULT '0' COMMENT '库存量',
  `T1` tinyint(4) DEFAULT '0',
  `title` varchar(512) DEFAULT '""' COMMENT '物品名称',
  `funceffect` varchar(512) DEFAULT '""' COMMENT '物品功效',
  `shortdesc` varchar(512) DEFAULT '""' COMMENT '简单描述',
  `keywords` varchar(64) DEFAULT '""' COMMENT '搜索关键字',
  `T2` tinyint(2) NOT NULL DEFAULT '0',
  `usebuy` int(11) DEFAULT NULL COMMENT '是否可以购买，0售完',
  `weight` int(11) NOT NULL DEFAULT '0' COMMENT '重量，单位克',
  `unit` varchar(100) NOT NULL DEFAULT '""' COMMENT '规格，包，袋，把',
  `from` varchar(100) NOT NULL DEFAULT '""' COMMENT '产地',
  `storetype` varchar(100) NOT NULL DEFAULT '""' COMMENT '存储方式',
  `nvalue` varchar(512) DEFAULT '""' COMMENT '营养价值',
  `T3` tinyint(4) DEFAULT '0',
  `description` varchar(4096) NOT NULL DEFAULT '""' COMMENT '详细描述',
  `thumbnailsurl` varchar(512) DEFAULT '""' COMMENT '物品小图片',
  `bigimgurl` text COMMENT '大图片地址',
  `linkurl` varchar(512) DEFAULT '""' COMMENT '点击后链接',
  `T4` tinyint(4) DEFAULT '0',
  `buycnt` int(11) NOT NULL DEFAULT '0' COMMENT '销量',
  `visitcnt` int(11) NOT NULL DEFAULT '0' COMMENT '访问量',
  `refundcnt` int(11) NOT NULL DEFAULT '0' COMMENT '退货量',
  `is_valid` int(11) NOT NULL DEFAULT '1',
  `sort` int(11) DEFAULT '99999' COMMENT '排序，从小到大',
  `hits` int(11) DEFAULT '0' COMMENT '点击数',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=310 DEFAULT CHARSET=utf8 COMMENT='物品表';

