/*Table structure for table `t_order` */

DROP TABLE IF EXISTS `t_order`;

CREATE TABLE `t_order` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order` int(11) NOT NULL COMMENT '订单编号',
  `user_id` int(11) NOT NULL,
  `from` int(11) NOT NULL COMMENT '来源：0app1门店2微信3网站',
  `itemlist` varchar(1024) NOT NULL COMMENT '物品列表(itemid，名称，价格，规格，数量，img)',
  `state` int(11) NOT NULL COMMENT '状态0待支付1待拣货2待配送3完成4取消',
  `couponprice` int(11) NOT NULL COMMENT '优惠卷金额 单位分',
  `peiprice` int(11) NOT NULL COMMENT '配送费',
  `scoreprice` int(11) NOT NULL COMMENT '积分抵扣金额 单位分',
  `ye` int(11) NOT NULL COMMENT '余额抵扣金额 单位分',
  `productprice` int(11) NOT NULL COMMENT '商品金额',
  `lastprice` int(11) NOT NULL COMMENT '应付金额',
  `name` varchar(100) NOT NULL COMMENT '收货人名称',
  `phone` bigint(64) NOT NULL,
  `addr` varchar(512) NOT NULL,
  `shopid` int(11) NOT NULL COMMENT '商店id',
  `shopname` varchar(100) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `order` (`order`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

